import matches from '../data/matches.json';

const MatchList = () => {
  return (
    <div className="p-4">
      {matches.map((match) => (
        <div key={match.match_id} className="flex items-center gap-4 p-4 border-b">
          {/* Player 1 */}
          <div className="flex items-center gap-2">
            <img src={match.player1.avatar} alt={match.player1.name} className="w-10 h-10 rounded-full" />
            <div>
              <p className="font-bold flex items-center gap-2">
                {match.player1.name} <span>{match.player1.country}</span>
              </p>
              <p className="text-sm text-gray-500">Rating: {match.player1.rating}</p>
            </div>
          </div>

          <p className="font-bold text-lg mx-4">vs</p>

          {/* Player 2 */}
          <div className="flex items-center gap-2">
            <img src={match.player2.avatar} alt={match.player2.name} className="w-10 h-10 rounded-full" />
            <div>
              <p className="font-bold flex items-center gap-2">
                {match.player2.name} <span>{match.player2.country}</span>
              </p>
              <p className="text-sm text-gray-500">Rating: {match.player2.rating}</p>
            </div>
          </div>

          <p className="ml-auto text-green-600 font-bold">{match.score}</p>
        </div>
      ))}
    </div>
  );
};

export default MatchList;
